import React from 'react';
import Footer from './Footer';
import Map from './Map';
import background from './net.png';
import Form from './Form.js';

function App() {
  return (
      <div style={{backgroundImage: `url('${background}')`, backgroundSize: '100%',
          backgroundAttachment: 'fixed'}}>
          <React.Fragment>
              <Form/>
              <Map/>
              <Footer/>
          </React.Fragment>
      </div>
  );
}
export default App;
